import{_ as a,c as e,o as s,a4 as r}from"./chunks/framework.DBIahkuf.js";const h=JSON.parse('{"title":"DragGAN开源图像AI工具","description":"","frontmatter":{},"headers":[],"relativePath":"Document/各行业AI工具集/图像视频相关AI工具/DragGAN开源图像AI工具.md","filePath":"Document/各行业AI工具集/图像视频相关AI工具/DragGAN开源图像AI工具.md","lastUpdated":1708941732000}'),n={name:"Document/各行业AI工具集/图像视频相关AI工具/DragGAN开源图像AI工具.md"},o=r(`<h1 id="draggan开源图像ai工具" tabindex="-1">DragGAN开源图像AI工具 <a class="header-anchor" href="#draggan开源图像ai工具" aria-label="Permalink to &quot;DragGAN开源图像AI工具&quot;">​</a></h1><h2 id="简介" tabindex="-1">简介 <a class="header-anchor" href="#简介" aria-label="Permalink to &quot;简介&quot;">​</a></h2><p>DragGAN 是一款基于生成对抗网络（GANs）技术的图片编辑项目。追根溯源，其实还是 NVIDIA 的 StyleGAN 的衍生项目。</p><p>&quot;Diffusion&quot; 和 &quot;GAN（生成对抗网络）&quot;都是生成模型，它们用于从某些数据分布中生成新的样本。但是，它们在理论和实践上都有一些重要的区别。</p><p>GAN，或者说生成对抗网络，是由两个网络组成的模型：生成器和鉴别器。生成器试图创建与真实数据类似的假数据，而鉴别器的任务是尝试区分真实数据和生成的假数据。GAN的主要目标是使生成器产生的数据能够在鉴别器中被判断为真实的。</p><p>另一方面，&quot;Diffusion&quot;模型则基于随机过程的观念。在这个模型中，一开始会有一个随机噪声，然后通过一系列时间步骤，这个噪声会逐渐变化，最终变得与目标数据分布相似。在每个时间步骤中，模型都会向数据添加或移除一些噪声。</p><p>两者之间的一个主要区别是，GAN使用了对抗的方式来生成数据，而Diffusion模型则是通过一种逐步的、基于噪声的过程来生成数据。虽然两者都可以生成新的数据样本，但它们的应用和性能可能会在不同的任务和数据集上有所不同。</p><h2 id="相关地址" tabindex="-1">相关地址 <a class="header-anchor" href="#相关地址" aria-label="Permalink to &quot;相关地址&quot;">​</a></h2><p>开源地址：<a href="https://github.com/XingangPan/DragGAN" target="_blank" rel="noreferrer">XingangPan/DragGAN: Official Code for DragGAN (SIGGRAPH 2023) (github.com)</a></p><p>DragGAN 全功能实现，在线Demo，本地部署试用，代码、模型已全部开源，支持Windows, macOS, Linux：<a href="https://github.com/Zeqiang-Lai/DragGAN" target="_blank" rel="noreferrer">https://github.com/Zeqiang-Lai/DragGAN</a></p><p>官网：<a href="https://vcai.mpi-inf.mpg.de/projects/DragGAN" target="_blank" rel="noreferrer">https://vcai.mpi-inf.mpg.de/projects/DragGAN</a></p><p>论文：<a href="https://vcai.mpi-inf.mpg.de/projects/DragGAN/data/paper.pdf" target="_blank" rel="noreferrer">https://vcai.mpi-inf.mpg.de/projects/DragGAN/data/paper.pdf</a></p><p>OpenXLab在线Demo：<a href="https://openxlab.org.cn/apps/detail/XingangPan/DragGAN" target="_blank" rel="noreferrer">https://openxlab.org.cn/apps/detail/XingangPan/DragGAN</a></p><p>教程：【期待已久的DragGAN源代码来了，尝鲜版】<a href="https://www.bilibili.com/video/BV1Us4y1T7WD?vd_source=36c9491a7fa2ab8a22ca060af01b7472" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1Us4y1T7WD?vd_source=36c9491a7fa2ab8a22ca060af01b7472</a></p><p>免部署一键运行包1.2可用自己的图片版下载地址：（原作者：万能软件君）</p><ul><li>WIN版（仅支持Windows 10、11）】下载链接：<a href="https://pan.quark.cn/s/8d2459f6eee3" target="_blank" rel="noreferrer">https://pan.quark.cn/s/8d2459f6eee3</a> 提取码：wcZ5</li><li>MAC版（仅支持Mac OS暂不支持自定义图片）下载链接: <a href="https://pan.baidu.com/s/1nCgouL5SyuOldQko3S5kYQ?pwd=28xb" target="_blank" rel="noreferrer">https://pan.baidu.com/s/1nCgouL5SyuOldQko3S5kYQ?pwd=28xb</a> 提取码: 28xb</li></ul><p>（苹果如果提示不信任的开发者，则如下： 搜索找到终端，然后输入 <code>sudo spctl --master-disable</code>，回车，输入电脑密码即可。)</p><p>自定义图片因为要反演所以对显卡要求很高经本up测试2080 8g是下限，建议4090 24g以上，显卡达不行可以尝试</p><ul><li>推荐的云端服务器：【无门槛！一键云端运行Stable diffusion最适合纯小白在线使用的SD云端服务器】 ：<a href="https://www.bilibili.com/video/BV1VM4y1n7cu/" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1VM4y1n7cu/</a></li><li>上传使用自己的图片看这个教程：【喜大普奔！】DragGAN终于可以用上自己的图片了！免安装、免部署、无脑一键本地包运行1.2版使用教程：<a href="https://www.bilibili.com/video/BV1yh411P7YR/" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1yh411P7YR/</a>?</li><li>【一键换脸哪家强？SD插件太超强！超绝无敌Roop换脸插件安装使用详解，免坑避雷！整合包用户必看】：<a href="https://www.bilibili.com/video/BV1ia4y1A7KD/?share_source=copy_web" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1ia4y1A7KD/?share_source=copy_web</a></li><li>【比PS更胜一筹的SD controlnet一键扩图，无需预设扩图范围】 <a href="https://www.bilibili.com/video/BV1VV4y117Jh/?share_source=copy_web&amp;vd_source=2ad4a8ecd1ccf53fc3a0f15f431c7969" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1VV4y117Jh/?share_source=copy_web&amp;vd_source=2ad4a8ecd1ccf53fc3a0f15f431c7969</a></li><li>【Lora选得好爽图随便跑！AI自动生成节日海报——几个端午节Lora模型分享】 <a href="https://www.bilibili.com/video/BV1Yo4y1P7Ek/?share_source=copy_web&amp;vd_source=2ad4a8ecd1ccf53fc3a0f15f431c7969" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1Yo4y1P7Ek/?share_source=copy_web&amp;vd_source=2ad4a8ecd1ccf53fc3a0f15f431c7969</a></li><li>【从此不愁提示词！小日子过的不错才能搞出来出的SD顺滑AI提示词插件】 <a href="https://www.bilibili.com/video/BV1gP411z7sF/?share_source=copy_web&amp;vd_source=2ad4a8ecd1ccf53fc3a0f15f431c7969" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1gP411z7sF/?share_source=copy_web&amp;vd_source=2ad4a8ecd1ccf53fc3a0f15f431c7969</a></li><li>【PS+AI双剑合璧插件最新版！两巨佬合体天下无敌！Auto-PS-SD-Plugin插件安装方法和使用】 <a href="https://www.bilibili.com/video/BV1124y1N77a/?share_source=copy_web&amp;vd_source=2ad4a8ecd1ccf53fc3a0f15f431c7969" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1124y1N77a/?share_source=copy_web&amp;vd_source=2ad4a8ecd1ccf53fc3a0f15f431c7969</a></li><li>【PS最新版炸裂来袭！集成Ai一键移除!一键傻瓜修图!使用详解——感谢Adobe献给六月的礼物！】 <a href="https://www.bilibili.com/video/BV1Yo4y1g7B7/?share_source=copy_web&amp;vd_source=2ad4a8ecd1ccf53fc3a0f15f431c7969" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1Yo4y1g7B7/?share_source=copy_web&amp;vd_source=2ad4a8ecd1ccf53fc3a0f15f431c7969</a></li><li>share_source=copy_web&amp;vd_source=2ad4a8ecd1ccf53fc3a0f15f431c7969</li><li>【stable diffusion 一个Ai插件让女神成为话痨，美照秒变虚拟主播！一步到位很简单】 <a href="https://www.bilibili.com/video/BV1bm4y1h7aL/?share_source=copy_web&amp;vd_source=2ad4a8ecd1ccf53fc3a0f15f431c7969" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1bm4y1h7aL/?share_source=copy_web&amp;vd_source=2ad4a8ecd1ccf53fc3a0f15f431c7969</a></li><li>【史上最牛Ai中文提示词插件——stable diffusion爽爆中文实时提示词！多国语言丝滑互转！】 <a href="https://www.bilibili.com/video/BV1ez4y1a7vY/?share_source=copy_web&amp;vd_source=2ad4a8ecd1ccf53fc3a0f15f431c7969" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1ez4y1a7vY/?share_source=copy_web&amp;vd_source=2ad4a8ecd1ccf53fc3a0f15f431c7969</a></li><li>让AI海啸般疯狂输出人设图！——stable diffusion游戏、动漫人物转面设计图一招搞定！<a href="https://www.bilibili.com/video/BV1em4y1y7wP/?spm_id_from=333.999.0.0" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1em4y1y7wP/?spm_id_from=333.999.0.0</a></li></ul><blockquote><p><strong>复刻方案一</strong></p><p><em>▢</em> GitHub：<a href="https://github.com/endo-yuki-t/UserControllableLT" target="_blank" rel="noreferrer">github.com/endo-yuki-t…</a></p><p><em>▢</em> Colab：<a href="https://github.com/camenduru/UserControllableLT-colab" target="_blank" rel="noreferrer">github.com/camenduru/U…</a></p></blockquote><blockquote><p><strong>复刻方案二</strong></p><p><em>▢</em> GitHub：<a href="https://github.com/Zeqiang-Lai/DragGAN" target="_blank" rel="noreferrer">github.com/Zeqiang-Lai…</a></p><p><em>▢</em> Colab：<a href="https://colab.research.google.com/github/Zeqiang-Lai/DragGAN/blob/master/colab.ipynb" target="_blank" rel="noreferrer">colab.research.google.com/github/Zeqi…</a></p></blockquote><blockquote><p><strong>复刻方案三</strong></p><p><em>▢</em> GitHub：<a href="https://github.com/JiauZhang/DragGAN" target="_blank" rel="noreferrer">github.com/JiauZhang/D…</a></p></blockquote><h2 id="部署要求" tabindex="-1">部署要求 <a class="header-anchor" href="#部署要求" aria-label="Permalink to &quot;部署要求&quot;">​</a></h2><ul><li>支持 Linux 和 Windows，建议使用 Linux</li><li>内存 12 GB 以上</li><li>1–8 NVIDIA 高端 GPU</li><li>Python &gt;= 3.8，PyTorch &gt;= 1.9.0</li><li>CUDA toolkit &gt;= 11.1</li></ul><h2 id="安装部署" tabindex="-1">安装部署 <a class="header-anchor" href="#安装部署" aria-label="Permalink to &quot;安装部署&quot;">​</a></h2><p>安装过程，真是一把鼻涕一把泪，到处都是坑，先是在阿里 PAI 平台栽跟头，折腾好久才发现是基础环境问题，后来又在安装方法上翻了车，官方的安装指导也是各种报错。</p><p>一路艰难摸索过来，现在将实测可行的一套部署方法带给大家。</p><p>这里我们选择 AutoDL 云平台，使用 Python 3.8，CUDA 11.8 的镜像，这个镜像的环境就已经满足项目要求了。</p><p><img src="https://p3-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/bf8543cf9ace48da8da92bf99cb8a55e~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp" alt="img"></p><h3 id="下载源码" tabindex="-1">下载源码 <a class="header-anchor" href="#下载源码" aria-label="Permalink to &quot;下载源码&quot;">​</a></h3><div class="language-bash line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki one-dark-pro vp-code"><code><span class="line"><span style="color:#61AFEF;">git</span><span style="color:#98C379;"> clone</span><span style="color:#98C379;"> https://github.com/XingangPan/DragGAN.git</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h3 id="安装依赖" tabindex="-1">安装依赖 <a class="header-anchor" href="#安装依赖" aria-label="Permalink to &quot;安装依赖&quot;">​</a></h3><div class="language-bash line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki one-dark-pro vp-code"><code><span class="line"><span style="color:#56B6C2;">cd</span><span style="color:#98C379;"> DragGAN</span></span>
<span class="line"><span style="color:#61AFEF;">pip</span><span style="color:#98C379;"> install</span><span style="color:#D19A66;"> -r</span><span style="color:#98C379;"> requirements.txt</span><span style="color:#D19A66;"> -i</span><span style="color:#98C379;"> https://pypi.tuna.tsinghua.edu.cn/simple</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br></div></div><p>如果出现下面的报错，代表这个 pip 源里没有对应的版本。</p><p><img src="https://p3-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/48a5bc6ecbbf4c058dbb3b5d7ada1068~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp" alt="img"></p><p>修改 <code>requirements.txt</code> 文件，去除特定版本依赖，再次执行即可。</p><div class="language-shell line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki one-dark-pro vp-code"><code><span class="line"><span style="color:#61AFEF;">torch&gt;</span><span style="color:#ABB2BF;">=2.0.0</span></span>
<span class="line"><span style="color:#61AFEF;">scipy</span></span>
<span class="line"><span style="color:#E06C75;">Ninja</span><span style="color:#56B6C2;">=</span><span style="color:#98C379;">=</span><span style="color:#D19A66;">1.10</span><span style="color:#98C379;">.2</span></span>
<span class="line"><span style="color:#61AFEF;">gradio&gt;</span><span style="color:#ABB2BF;">=3.35.2</span></span>
<span class="line"><span style="color:#61AFEF;">imageio-ffmpeg&gt;</span><span style="color:#ABB2BF;">=0.4.3</span></span>
<span class="line"><span style="color:#61AFEF;">huggingface_hub</span></span>
<span class="line"><span style="color:#61AFEF;">hf_transfer</span></span>
<span class="line"><span style="color:#61AFEF;">pyopengl</span></span>
<span class="line"><span style="color:#61AFEF;">imgui</span></span>
<span class="line"><span style="color:#E06C75;">glfw</span><span style="color:#56B6C2;">=</span><span style="color:#98C379;">=</span><span style="color:#D19A66;">2.6</span><span style="color:#98C379;">.1</span></span>
<span class="line"><span style="color:#61AFEF;">pillow&gt;</span><span style="color:#ABB2BF;">=9.4.0</span></span>
<span class="line"><span style="color:#61AFEF;">torchvision&gt;</span><span style="color:#ABB2BF;">=0.15.2</span></span>
<span class="line"><span style="color:#61AFEF;">imageio&gt;</span><span style="color:#ABB2BF;">=2.9.0</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br><span class="line-number">12</span><br><span class="line-number">13</span><br></div></div><h3 id="下载模型" tabindex="-1">下载模型 <a class="header-anchor" href="#下载模型" aria-label="Permalink to &quot;下载模型&quot;">​</a></h3><div class="language-bash line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki one-dark-pro vp-code"><code><span class="line"><span style="color:#61AFEF;">sh</span><span style="color:#98C379;"> scripts/download_model.sh</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p><img src="https://p3-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/37b31a5f020a4efa80f4515e66ce7def~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp" alt="img"></p><h3 id="运行" tabindex="-1">运行 <a class="header-anchor" href="#运行" aria-label="Permalink to &quot;运行&quot;">​</a></h3><p>这里选择运行 WebUI，看到 URL 就代表启动成功了。</p><div class="language-bash line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki one-dark-pro vp-code"><code><span class="line"><span style="color:#7F848E;font-style:italic;"># 运行 WebUI</span></span>
<span class="line"><span style="color:#61AFEF;">python</span><span style="color:#98C379;"> visualizer_drag_gradio.py</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br></div></div><p><img src="https://p3-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/a296ae859edc47259387f198357c0dfe~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp" alt="img"></p><h2 id="效果展示" tabindex="-1">效果展示 <a class="header-anchor" href="#效果展示" aria-label="Permalink to &quot;效果展示&quot;">​</a></h2><p>使用上非常简单，鼠标在图中点点就行，红点是起始点，蓝点是目标点，实现图像的拖拽效果。</p><p><img src="https://p3-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/03e5bf2218764e999ca4a79120ae2378~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp" alt="img"></p><p><img src="https://p3-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/4eb66eeab5eb43419a8b34ebe9220257~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp" alt="img"></p><p><img src="https://p3-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/c63521dde9714e70985bc05946559d49~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp" alt="img"></p><p><img src="https://p3-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/f820b830e126425e8e095c0a846617e8~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp" alt="img"></p><p>还可以控制区域图像，避免整体图像跟着变化。</p><p><img src="https://p3-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/4df03900a95a42b2af0a41940bf59555~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp" alt="img"></p><p><img src="https://p3-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/0de59377adbf43cd9f18032904669ff5~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp" alt="img"></p><p>很多人都以为这个项目能直接选一张照片，就能像 PS 一样进行 P 图了，其实并不是，至少目前还不支持，上面你看到的这些图片都是经过训练而生成的模型，所以本质上，你是在操作一个模型，而非图片！</p><p>如果你想操作自己的图片，那么按官网说的，你需要使用到 <a href="https://danielroich/PTI" target="_blank" rel="noreferrer">PTI</a> 项目，将你自定义的图片训练成 StyleGAN 模型。</p><h2 id="北大团队用diffusion升级draggan-泛化更强生成质量更高" tabindex="-1">北大团队用Diffusion升级DragGAN，泛化更强生成质量更高 <a class="header-anchor" href="#北大团队用diffusion升级draggan-泛化更强生成质量更高" aria-label="Permalink to &quot;北大团队用Diffusion升级DragGAN，泛化更强生成质量更高&quot;">​</a></h2><p><a href="https://zhuanlan.zhihu.com/p/647535012" target="_blank" rel="noreferrer">北大团队用Diffusion升级DragGAN，泛化更强生成质量更高，点一点「大山拔地而起」 - 知乎 (zhihu.com)</a></p><p>论文地址：[<a href="https://arxiv.org/abs/2307.02421" target="_blank" rel="noreferrer">2307.02421] DragonDiffusion: Enabling Drag-style Manipulation on Diffusion Models (arxiv.org)</a></p><p>开源项目地址：<a href="https://github.com/MC-E/DragonDiffusion" target="_blank" rel="noreferrer">MC-E/DragonDiffusion (github.com)</a></p><p>项目主页：<a href="https://mc-e.github.io/project/DragonDiffusion/" target="_blank" rel="noreferrer">DragonDiffusion: Enabling Drag-style Manipulation on Diffusion Models (mc-e.github.io)</a></p>`,60),p=[o];function i(l,t,c,b,f,d){return s(),e("div",null,p)}const m=a(n,[["render",i]]);export{h as __pageData,m as default};
